L'heure moyenne de Greenwich, en anglais Greenwich Mean Time, abrégé en GMT, est l'heure solaire moyenne au méridien de Greenwich, méridien d’origine des longitudes, traversant l’Observatoire royal de Greenwich, près de Londres en Angleterre. L'heure moyenne de Greenwich a servi de référence temporelle dans le monde pendant la majeure partie du XXe siècle, avant d’être remplacée par le Temps universel coordonné (UTC) en 1972. Par abus de langage, GMT est souvent employé comme synonyme du fuseau horaire UTC+0, également appelé Western European Time. Les deux mesures de temps, quoique proches, ne coïncident cependant pas, puisque GMT est établi sur la rotation terrestre et UTC sur le Temps atomique international. Elle correspond à l'heure d'hiver : 
*  à 15h GMT en hiver, il est 15h à Londres et 16h à Paris ; 
*  à 15h GMT en été, il est 16h à Londres et 17h à Paris.
